import React, {useEffect, useState} from 'react';
import './App.css';
import {Link} from  'react-router-dom';



function CreateInterview(event){

  useEffect(() => {

      console.log("I am in CreateInterview ");  
      event.preventDefault();
      const data = new FormData(event.target);
      var object   = {}
      data.forEach((value, key) => {object[key] = value});

      perform_function();
  },[]);

  // console.log(object);
   const perform_function = async(json_object) => {
       const options = 
        {
            method: 'POST',
            body: JSON.stringify(json_object),
            mode: 'cors',
            headers: {
                'Content-Type': 'application/json'
            }
        };
        try 
        {
            const response = await fetch(`http://localhost:3000/api/v1/interviews`, options);
            window.location = "/interviews";

        } 
        catch (err) 
        {
            console.log('Error getting documents', err)
            window.location = "/interviews";
        }
    }
}



function NewInterview() {
  useEffect(() => {
    // fetchItem();
  },[]);

  return (
        <div>
            <form onSubmit = {CreateInterview} class="section">
                    <div class="field">
                        <p class="control has-icons-left has-icons-right">
                            <label for="title">User Name:</label>
                            <input class="input" name="user_name" type="text" />
                        </p>
                    </div>
                    <div class="field">
                        <p  class="control has-icons-left has-icons-right">
                            <label for="user_id">User Id:</label>
                            <input class="input" name="user_id" type="number" />
                        </p>
                    </div>
                    <div class="field">
                        <p class="control has-icons-left has-icons-right">
                            <label for="title">Title:</label>
                            <input class="input" name="title" type="text" />
                        </p>
                    </div>
                    <div class="field">
                        <p class="control has-icons-left has-icons-right">
                            <label for="title">Role:</label>
                            <input class="input" name="role" type="text" />
                        </p>
                    </div>
                    <div class="field">
                        <p class="control has-icons-left has-icons-right">
                            <label for="title">Start Time:</label>
                            <input class="input" name="start_time" type="datetime-local" />
                        </p>
                    </div>
                    <div class="field">
                        <p class="control has-icons-left has-icons-right">
                            <label for="title">End Time:</label>
                            <input class="input" name="end_time" type="datetime-local" />
                        </p>
                    </div>
                    <div class="field">
                        <p class="control has-icons-left has-icons-right">
                            <label for="title">Meeting Link:</label>
                            <input class="input" name="meet_link" type="text" />
                        </p>
                    </div>

                    <div class="field">
                        <p class="control">
                            <input class="input" type="submit" />
                        </p>
                    </div>
            </form>
        </div>
  );


}

export default NewInterview;
